INSERT INTO `planasignatura` (`CodigoPlan`, `Programa`, `Materia`, `Hdd`, `Htp`, `Hti`, `TipoAsignatura`, `NaturalezaAsignatura`, `DescripcionAsignatura`, `ObjetivoGeneral`, `ObjetivosEspecificos`, `EstrategiasPedagogicas`, `CompetenciasGenericas`, `ReferenciasBibliograficas`, `PrimerParcial`, `SegundoParcial`, `TercerParcial`, `FechaRegistro`) VALUES
('pli01', 'Ingenieria de sistemas', 'calculo', 45, 50, 80, 'Teorica', 'Habilitable', 'El desarrollo de software con calidad requiere la aplicación de técnicas, metodologías,\r\nactividades, tecnologías eficientes, trabajo en equipo y la consolidación de ideas que permitan\r\nobtener un producto final verificado y validado correctamente conforme a las especificaciones\r\ndadas por el usuario. En concordancia con lo anterior el estudiante debe apropiarse de los\r\nconocimientos detallados en aras de fortalecer su rol como ingeniero de software.', 'Comprender los conceptos fundamentales, proceso de software y metodologías propuestas por\r\nla ingeniería de software, su aplicabilidad e importancia en el desarrollo de productos de\r\nsoftware con calidad.', 'Entender los conceptos básicos e introductorios de ingeniería de software para su\r\nposterior aplicación.\r\n\r\nConocer los conceptos fundamentales sobre sistemas de información y su importancia\r\nen la toma de decisiones en una organización.\r\n\r\nAplicar las metodologías, métodos y actividades utilizados durante el proceso de\r\ndesarrollo de software', 'trabajo presencial o acompañamiento directo: consiste en el tiempo dedicado a la\r\nactividad académica en la que hay interacción entre el docente y el estudiante, a través de\r\nclases magistrales, seminarios, talleres, y laboratorios; donde se da explicación a los temas\r\nprogramados en el curso, se realiza en las instalaciones de la institución en horarios definidos\r\npreviamente y en espacios destinados para ello tales como: salones de clases, salas de\r\nsistemas e informática, laboratorios, visitas técnicas y demás lugares que permitan y cumplan\r\ncon las normas exigidas para impartir clases.', 'Comprende un texto y sus partes para reflexionar, profundizar y aplicar\r\nsu conocimiento en ámbitos cotidianos, académicos y profesionales.', 'CAMPOS Víctor, “Ingeniería del Software”, Ed. Pearson educación, 5ta edición, España 2011.\r\n FERNANDEZ Rubén, *Utilización de UML en ingeniería del software con objetos y\r\ncomponentes”, Ed. Pearson Educación, 5ta edición, España 2007.\r\n GUERRERO Ekaterina, “Ingeniería del Software clásica y orientada a objetos”, Ed. Pearson\r\neducación, 6ta edición, España 2011.', 30, 30, 40, '2020-12-12 02:27:44'),
